import React from 'react';
import logo from './logo.svg';
import './App.css';
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

function App() {
  return (
      <Grid container spacing={3}>
        <Grid item md={10}>
          <Paper>
            DIOCANE12
          </Paper>
        </Grid>
        <Grid item md={5}>
          <Paper>
            DIOCANE5
          </Paper>
        </Grid>
        <Grid item md={5}>
          <Paper>
            DIOCANE5
          </Paper>
        </Grid>
        <Grid item md={3}>
          <Paper>
            DIOCANE3
          </Paper>
        </Grid>
      </Grid>
  );
}

class Componentino extends React.Component {
  constructor(props){
    super(props);
    this.state={ora: new Date()};

    this.tick = this.tick.bind(this);
  }

  componentDidMount(){
    this.timerID = setInterval(this.tick, 1000);
  }

  componentWillUnmount (){
    clearInterval(this.timerID);
  }

  render() {
    return (<h1>Funziona porco cazzo: {this.state.ora.toLocaleTimeString()}</h1>);
  }

  tick (){
    this.setState({ora:new Date()});
  }
}

export default App;
